import {Component} from 'react';
import {Navbar, Nav, NavDropdown, Container} from 'react-bootstrap'
import NagdaaLogo from '../public/media/logoNagda.svg';
import LogoRectengle from '../public/media/logoRectengle.svg';
import {connect} from 'react-redux'
import IniStateModel from '../models/redux.state.ini';

class AppNavBar extends Component {

    static getInitialProps() {

        return {
            state: IniStateModel
        }
    }


    componentDidMount() {

        console.log(this.props)
    }

    render() {
        return (
            <Navbar expand="md" className="py-4">
                <Container>

                    <div className="">
                        <Navbar.Brand href="/home" className="d-flex flex-row">
                            <div className="position-relative">
                                <img src={LogoRectengle} className=""/>
                                <img src={NagdaaLogo} className='position-absolute nagaaLogo'/>
                            </div>
                            <h2 className="text-muted mt-4 mr-2 Cairo-bold">نجدة</h2>
                        </Navbar.Brand>
                    </div>

                    <Navbar.Toggle aria-controls="basic-navbar-nav" className=""/>
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link
                                href="/home"
                                className={this.props.activeLink == 'home' ? 'active' : ""}>الرئيسية</Nav.Link>
                            <Nav.Link
                                href="/mobileApp"
                                className={this.props.activeLink == 'mobile-app' ? 'active' : ""}>التطبيق
                                الزكي</Nav.Link>
                            <Nav.Link
                                href="/"
                                className={this.props.activeLink == 'web-app' ? 'active' : ""}> تطبيق
                                الويب</Nav.Link>
                            <Nav.Link
                                href="#link"
                                className={this.props.activeLink == 'whose-we-are' ? 'active' : ""}>من
                                نحن</Nav.Link>
                            <Nav.Link
                                href="#link"
                                className={this.props.activeLink == 'contact-us' ? 'active' : ""}>تواصل
                                معنا</Nav.Link>
                            <Nav.Link
                                href="#link"
                                className={this.props.activeLink == 'home' ? 'faq' : ""}>اسئلة
                                مكرره</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>

                </Container>

            </Navbar>
        )
    }
}

const MapStateToProps = (state) => {
    return {
        ...state,
    }
};

export default connect(MapStateToProps)(AppNavBar);
